window.bookSummaryJSON = "<p>The Nowhere Man is a figure shrouded in secrecy - a near legendary figure who helps the truly desperate, those with nowhere else to turn who are lucky enough to be able to reach out to him. When darkness closes in, the Nowhere Man is your last, best hope.</p> <p>Before he was the Nowhere Man, Evan Smoak was a highly trained government operative known to a few as Orphan X. But he now lives by hiding in plain sight, keeping his head down and his eyes clear. So when a local summer intern for a tabloid news site finds herself trailing an aggressive reporter into a crime zone, things go terribly awry. The only person who can help her is a man with the background and the skills of the Nowhere Man.</p> <p>From <i>New York Times</i> bestselling author Gregg Hurwitz comes an electrifying, original story in his “nerve-shredding” internationally #1 bestselling Orphan X series.</p>"; 
